import Grid from "./Grid";
import "./App.css";

function App() {
  return (
    <div className="app">
      <header className="header">
        <img src="/logo.png" alt="Logo" className="logo" />
        <h1>Fullstack Developer Assignment</h1>
        <p>Technology - React.js</p>
      </header>
      <Grid rows={15} columns={20} />
    </div>
  );
}

export default App;
